fn length_of_longest_substring(s: String) -> i32 {
    let start = Instant::now();
    let l = s.len();
    let mut v: Vec<String> = vec![];
    for i in 0..l {
        let new_str = s.get(i..l).unwrap().to_string();
        let mut substr = String::from("");
        for c in new_str.chars() {
            if substr.contains(c) {
                break;
            } else {
                substr.push(c);
                let el = substr.clone();
                v.push(el);
            }
        }
    }
  


    let mut max = 0;
    for i in &v {
        if i.len() > max {
            max = i.len();
        }
    }
    let duration = start.elapsed();
    println!("Time elapsed in expensive_function() is: {:?}", duration);

    max as i32
}
